// Preview.js
import React from "react";
import { useLocation, useNavigate } from "react-router-dom";

export default function Preview() {
  const location = useLocation();
  const navigate = useNavigate();
  
  // QuoteForm에서 넘긴 데이터 받기
  const { formData, costs } = location.state || {};

  if (!formData || !costs) {
    // 데이터 없으면 메인폼으로 이동
    navigate("/");
    return null;
  }

  // VAT 계산 (예: 10%)
  const vatTotal = Math.round(costs.totalCost * 1.1);

  // 견적 항목 배열 만들기 (formData와 costs를 기반으로)
  const services = [];

  if (formData.includeBase) {
    services.push({ name: "거래구조 및 과세자료 제출 범위 검토", price: costs.baseCost });
  }
  if (formData.includeReason) {
    services.push({ name: "과세자료 미제출 사유서 작성 지원", price: costs.reasonCost });
  }
  if (formData.includeDoc) {
    services.push({ name: "과세자료 제출 서류 정비 및 전자제출 대행", price: costs.docCost });
  }
  if (formData.includeReport) {
    services.push({ name: "과세가격 결정 사유 보고서 작성", price: costs.reportCost });
  }
  if (formData.includeRelated) {
    services.push({ name: "특수관계자 거래 분석 및 이전가격 검토 리포트", price: costs.relatedCost });
  }

  const now = new Date();
  const dueDate = new Date(now);
  dueDate.setDate(now.getDate() + 15);

  return (
    <div style={{ fontFamily: "'Segoe UI', 'Helvetica Neue', sans-serif", padding: 60, backgroundColor: "#fff", color: "#333", fontSize: 14, lineHeight: 1.6 }}>
      <header style={{ marginBottom: 30 }}>
        <div style={{ fontSize: 14, letterSpacing: "1.5px", color: "#666", textTransform: "uppercase", fontWeight: 500 }}>
          THE HANYOUNG CUSTOMS SERVICES
        </div>
        <h1 style={{ fontSize: 48, fontWeight: 700, letterSpacing: "2px", margin: "5px 0 0", color: "#111" }}>INVOICE</h1>
      </header>

      <table style={{ width: "100%", marginBottom: 20 }}>
        <tbody>
          <tr>
            <td style={{ fontWeight: "bold" }}>수신</td>
            <td>{formData.company}</td>
            <td style={{ fontWeight: "bold" }}>발신</td>
            <td>관세법인 한영</td>
          </tr>
          <tr>
            <td style={{ fontWeight: "bold" }}>일자</td>
            <td>{now.toLocaleDateString("ko-KR")}</td>
            <td style={{ fontWeight: "bold" }}>문서번호</td>
            <td>{formData.doc_number}</td>
          </tr>
        </tbody>
      </table>

      <p style={{ fontStyle: "italic", marginBottom: 40 }}>
        한영이라는 이름이 기업에게 자산이 될 수 있도록, 언제나 고객의 기대를 뛰어넘는 관세법인 한영이 되겠습니다.
      </p>

      <div style={{ backgroundColor: "#f7f5f2", padding: 40 }}>
        <table style={{ width: "100%", borderCollapse: "collapse", marginBottom: 40 }}>
          <thead>
            <tr style={{ backgroundColor: "#f9f9f9", fontWeight: 600 }}>
              <th style={{ border: "1px solid #ddd", padding: 12 }}>NO</th>
              <th style={{ border: "1px solid #ddd", padding: 12 }}>상세</th>
              <th style={{ border: "1px solid #ddd", padding: 12 }}>수량</th>
              <th style={{ border: "1px solid #ddd", padding: 12 }}>단가 (원)</th>
              <th style={{ border: "1px solid #ddd", padding: 12 }}>금액 (원)</th>
            </tr>
          </thead>
          <tbody>
            {services.map((item, index) => (
              <tr key={index}>
                <td style={{ border: "1px solid #ddd", padding: 12 }}>{index + 1}</td>
                <td style={{ border: "1px solid #ddd", padding: 12 }}>{item.name}</td>
                <td style={{ border: "1px solid #ddd", padding: 12 }}>1</td>
                <td style={{ border: "1px solid #ddd", padding: 12 }}>{item.price.toLocaleString()}</td>
                <td style={{ border: "1px solid #ddd", padding: 12 }}>{item.price.toLocaleString()}</td>
              </tr>
            ))}
          </tbody>
        </table>

        <table style={{ width: "100%", marginBottom: 40 }}>
          <tbody>
            <tr>
              <td style={{ fontWeight: "bold" }}>합계 :</td>
              <td style={{ textAlign: "right" }}>{costs.totalCost.toLocaleString()} 원</td>
            </tr>
            <tr>
              <td style={{ fontWeight: "bold" }}>V.A.T 포함:</td>
              <td style={{ textAlign: "right" }}>{vatTotal.toLocaleString()} 원</td>
            </tr>
          </tbody>
        </table>

        <table style={{ width: "100%", marginBottom: 40 }}>
